INSERT INTO `faleconosco` VALUES (1,'4955892','Andreza Matsuyo Suzuki Policarpo','86398449','PR','eduardopolicarpo@gmail.com','03200658983','1980-10-24','(43) 99955-7904','','SIM','00445144461','2014-04-20','PR','','','','[ Enviada em 14/10/2019 13:47:24 ]\r\nOk, mas qual é o valor da taxa para agendar a pericia ?\r\n[ Enviado em 14/10/2019 13:25:55 ]\r\nSofri um acidente em 2015 na qual me deixou com sequelas motoras, gostaria de passar por pericia especial para renovar a minha habilitação como PNE, por onde eu devo começar ?\r\n\r\n','[ Enviada em 14/10/2019 13:53:55 Por Paulo Cesar Antoio ]\r\nfavor verificar qual é o valor atualizado para a pericia para exame de aptidão física especial\r\n\r\n','[ Enviada em 14/10/2019 13:55:36 Por Eduardo Policarpo da Silva ]\r\nO valor da pericia especial é R$195,00\r\n\r\n','[ Enviada em 14/10/2019 13:57:46 Por Paulo Cesar Antoio ]\r\nO valor é de R$195,00\r\n[ Enviada em 14/10/2019 13:31:36 Por Paulo Cesar Antoio ]\r\nVocê primeiramente deve entrar no site do detran e agendar uma pericia, pague  o boleto e compareça no horário e local agendado. O medico perito lhe fara uma avaliação e lhe orientará. É importante que você leve exames e laudos que comprovem sua deficiência.\r\n\r\n\r\n','fechado','2019-10-14 13:25:55'),(2,'4541900','Tania Oliveira','10.3532655','PR','taniaalessandra12@gmail.com','07092793963','1990-04-06','(43) 99900-5239','','NAO','',NULL,'','','','','[ Enviada em 14/10/2019 16:03:00 ]\r\nainda não ficou claro\r\n[ Enviado em 14/10/2019 16:00:32 ]\r\nTeste 123\r\n\r\n',NULL,NULL,'[ Enviada em 14/10/2019 16:02:24 Por Paulo Cesar Antoio ]\r\nesta é uma resposta teste\r\n\r\n','Retorno Cidadao','2019-10-14 16:00:30'),(3,'9459880','Matheus de Moraes Rosa','131906650','PR','eduardopolicarpo@gmail.com','10148595901','1988-03-15','(42) 99996-8992','','SIM','06316890434','2015-03-09','PR','','','','[ Enviado em 15/10/2019 11:34:40 ]\r\ngostaria de renovar minha carteira e incluir a observação EAR, mas nao achei essa opção para incluir no site nem no aplicativo\r\n','[ Enviada em 15/10/2019 11:38:06 Por Paulo Cesar Antoio ]\r\nPor gentileza favor verificar, pois no site realmente nao existe a opção\r\n\r\n',NULL,NULL,'supervisao','2019-10-15 11:34:42'),(4,'2230105','Joao Gabriel Battagli','80803656','PR','eduardopolicarpo@gmail.com','02971229912','1982-07-14','(41) 99668-4787','','SIM','0123654785','2019-09-16','PR','','','','[ Enviada em 15/10/2019 11:46:11 ]\r\nNão encontro a opção no site\r\n[ Enviado em 15/10/2019 11:43:05 ]\r\nESTOU COM DIFICULDADE DE AGENDAR O EXAME DE VISTA.\r\n\r\n','[ Enviada em 15/10/2019 11:47:51 Por Paulo Cesar Antoio ]\r\nfavor verificar pois realmente nao tem  a opção no site\r\n\r\n','[ Enviada em 15/10/2019 11:49:10 Por Eduardo Policarpo da Silva ]\r\nO departamento de TI do Detran corrigiu o problema favor responder ao cidadão para acessar novamente o site\r\n\r\n','[ Enviada em 15/10/2019 11:45:19 Por Paulo Cesar Antoio ]\r\nDescreva qual é a dificuldade por gentileza para que eu possa ajuda-lo ?\r\n\r\n','retorno detran','2019-10-15 11:43:07'),(5,'9722788','OLIVEIRA E ANTUNES ADVOGADOS DE BLUMENAU ','65354950','PR','eduardopolicarpo@gmail.com','13215192900','1973-03-22','(47) 99554-1238','','','',NULL,'','00556848098','MAF4213','','[ Enviado em 15/10/2019 15:07:19 ]\r\nPrezados, boa tarde!! Nós do Oliveira e Antunes advogados protocolamos um requerimento solicitando o cancelamento de averbação do art. 828 em uma placa. Como ela ainda consta com restrição, gostaria de verificar se é referente ao nosso processo, pois precisamos cancelar a nossa restrição com urgência. Peço que se possivel priorizem o cancelamento. Protocolo: 16.032.345-0 Placa: MAF4213, 00556848098 Processo: 0002502-35.2019.8.16.0159 Nossa restrição foi baixada? Aguardo retorno breve, muito obrigado!\r\n','[ Enviada em 15/10/2019 15:09:43 Por Paulo Cesar Antoio ]\r\nFavor verificar se ja houve baixa\r\n\r\n','[ Enviada em 15/10/2019 15:10:33 Por Eduardo Policarpo da Silva ]\r\nJa dei baixa conforme solicitado\r\n\r\n','[ Enviada em 15/10/2019 15:12:00 Por Paulo Cesar Antoio ]\r\nJa demos baixa conforme sua solicitação\r\n\r\n','fechado','2019-10-15 15:07:19'),(6,'8235675','THALYNE FARIAS','135489727','PR','eduardopolicarpo@gmail.com','09033579928','1990-02-14','(41) 99788-3562','','NAO','',NULL,'','','','','[ Enviado em 15/10/2019 15:17:19 ]\r\nEu estou com a minha permissão, e vai vencer, só que eu perdi ela em papel e agora não sei o número do registro da CNH pra mim tirar a definitiva, como eu faço para conseguir esse número, sem tirar a 2 via da PPD\r\n',NULL,NULL,NULL,'aberto','2019-10-15 15:17:19'),(7,'889164','Tania Oliveira','103532655','PR','taniaalessandra12@gmail.com','07092793963','1990-04-06','(43) 99900-5239','','NAO','',NULL,'','','','','[ Enviada em 16/10/2019 16:03:23 ]\r\nNão entendi.\r\n[ Enviada em 16/10/2019 15:58:42 ]\r\nMas e para colocar o EAR? Lá na Auto escola eu consigo?\r\n[ Enviado em 16/10/2019 15:57:03 ]\r\nGostaria de tirar a CNH como faço?\r\n\r\n\r\n',NULL,NULL,'[ Enviada em 16/10/2019 15:59:45 Por Paulo Cesar Antoio ]\r\nPrezado(a) Cidadão(ã),\r\n\r\nEm relação a sua solicitação, informamos que para incluir o EAR basta incluir no processo inicial junto a autoescola. \r\n\r\nAtenciosamente,\r\nTania\r\n\r\nO DETRAN-PR está a sua disposição, você também pode conseguir informação e serviços em nosso site www.detran.pr.gov.br ou baixe nosso Aplicativo Detran INTELIGENTE (IOS ou Android).\r\nNosso horário de atendimento presencial é das 08h00min às 14h00min de segunda a sexta-feira.\r\nNosso horário de atendimento na central de informações é das 08h00min às 20h00min de segunda a sexta-feira.\r\n[ Enviada em 16/10/2019 15:57:55 Por Paulo Cesar Antoio ]\r\nPrezado(a) Cidadão(ã),\r\n\r\nEm relação a sua solicitação, informamos que para retirar a CNH basta fazer a solicitação por meio da auto escola. \r\n\r\nAtenciosamente,\r\nTania\r\n\r\nO DETRAN-PR está a sua disposição, você também pode conseguir informação e serviços em nosso site www.detran.pr.gov.br ou baixe nosso Aplicativo Detran INTELIGENTE (IOS ou Android).\r\nNosso horário de atendimento presencial é das 08h00min às 14h00min de segunda a sexta-feira.\r\nNosso horário de atendimento na central de informações é das 08h00min às 20h00min de segunda a sexta-feira.\r\n\r\n\r\n','Retorno Cidadao','2019-10-16 15:57:06');
